// UserList.tsx
import React from 'react';
import useUsers from './useUsers';

const UserList: React.FC = () => {
  const { users } = useUsers();

  return (
    <div>
      <h2>User List</h2>
      <ul>
        {users.length > 0 ? (
          users.map(user => (
            <li key={user.id}>{user.username}</li>
          ))
        ) : (
          <li>No users found</li>
        )}
      </ul>
    </div>
  );
};

export default UserList;
